const Learners_Rank = () => {
  const tableHeading = ["جایگاه", "پروفایل", "نام", "وضعیت", "رتبه", "دوره"];
  return (
    <section className="pagecenter">
      <h3 className="title-lg text-center">
        <span className="halfbg-right">برترین دانشجویان شهریور ماه</span>
      </h3>
      <table class="table-auto">
        <thead>
          <tr>
            {tableHeading.map((item, index) => {
              return <th>{item}</th>;
            })}
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>The Sliding Mr. Bones (Next Stop, Pottersville)</td>
            <td>Malcolm Lockyer</td>
            <td>1961</td>
          </tr>
        </tbody>
      </table>
    </section>
  );
};

export default Learners_Rank;
